import React from "react";

function Header(){
    return(
    <header>
        <h1>Blog App</h1>
        <searchbar>
            <form>
                <input type="text" id="search" placeholder="search by title" ></input>
                <input type="submit"></input>
            </form>
        </searchbar>
    </header>
    );
}
export default Header;
